import React from "react";
import { ComposableMap, Geographies, Geography } from "react-simple-maps";
import { geoMercator } from "d3-geo";

const Map = () => {
    const amsterdamCoordinates = [4.9041, 52.3676];

    return (
        <div className="w-full h-full">
            <ComposableMap
                projection={geoMercator()
                    .center(amsterdamCoordinates)
                    .scale(50000) // Adjust scale for zoom level
                    .translate([500, 250])} // Translate to center map in viewport
                width={1000}
                height={500}
            >
                <Geographies geography="https://maps.amsterdam.nl/open_geodata/geojson_latlng.php?KAARTLAAG=INDELING_STADSDEEL&THEMA=gebiedsindeling">
                    {({geographies}) =>
                        geographies.map((geo) => (
                            <Geography key={geo.rsmKey} geography={geo}/>
                        ))
                    }
                </Geographies>
            </ComposableMap>
        </div>
    );
}

export default Map;
